The case 1 get the "arguments[0].get()" converted to Text (or String) so that we get true
to have a correct result. Here "arguments[0].get()" is the left side node in where clause.
constantInSet has Text node. 
The case 3 has both constantInSet and arguments[0].get() has IntWritable to get a correct
result. 
The second case 2 has IntWritable for constantInSet and LongWritable for the other, which 
causes "constantInSet.contains(..)" to return false. 

A patch might be to convert left side LongWritable node to IntWritable .
